entry.value:
def ff = session.get()
if(!ff)return

def line = new StringBuilder()

line.append("mttd")

// Tags
line.append(",app_name=").append(ff.getAttribute("app_name"))
line.append(",instance_name=").append(ff.getAttribute("instance_name"))
line.append(",detection_time=").append(ff.getAttribute("detection_time"))
line.append(",start_time=").append(ff.getAttribute("deployment_time_latest"))

line.append(" ")

// Metric
line.append("value=").append(ff.getAttribute("meantime"))

line.append(" ")

//def timestamp = Long.valueOf(ff.getAttribute("current_timestamp")) * 1000000
//line.append(timestamp)

def ffOut = session.create()
ffOut = session.write(ffOut, {outputStream ->
  outputStream.withWriter("UTF-8"){writer->
    writer.append(line)
  }
} as OutputStreamCallback )

ffOut = session.putAttribute(ffOut, "mime.type", "application/x-www-form-urlencoded")
ffOut = session.putAttribute(ffOut, "app_name", ff.getAttribute("app_name"))

session.remove(ff)

session.transfer(ffOut, REL_SUCCESS)

